import './BabyMomCare.css';

const babyMomProducts = [
  {
    name: 'Baby Lotion',
    description: 'Gentle moisturizer for baby skin. Hypoallergenic and dermatologist-tested.',
    price: 150,
    image: '/images/baby-mom/baby-lotion.jpg',
  },
  {
    name: 'Stretch Mark Cream',
    description: 'Reduces appearance of stretch marks. Safe for pregnancy and postpartum.',
    price: 280,
    image: '/images/baby-mom/stretch-mark-cream.jpg',
  },
  {
    name: 'Baby Shampoo',
    description: 'Tear-free formula for delicate baby hair and scalp.',
    price: 120,
    image: '/images/baby-mom/baby-shampoo.jpg',
  },
  {
    name: 'Nursing Pads',
    description: 'Soft and absorbent pads for breastfeeding comfort.',
    price: 200,
    image: '/images/baby-mom/nursing-pads.jpg',
  },
  {
    name: 'Diaper Rash Cream',
    description: 'Soothes and protects against diaper rash. Pediatrician recommended.',
    price: 160,
    image: '/images/baby-mom/diaper-rash-cream.jpg',
  },
];

const BabyMomCare = () => {
  return (
    <div className="baby-mom-container container py-4">
      <h2 className="text-center mb-4">ðŸ‘¶ Baby & Mom Care Products</h2>
      <div className="row">
        {babyMomProducts.map((product, index) => (
          <div key={index} className="col-md-4 mb-4">
